    if a == b:
        return 0
    (a, b) = (max(a, b), min(a, b))
    xx = a // b
    if a % b != 0 or xx & xx * 1 != 0:
        return -1
    ans = 0
    for base in [8, 4, 2]:
        if xx == 1:
            break
        log_val = int(math.log(xx, base))
        ans += log_val
        xx //= base ** log_val
    return ans

